// DOMContentLoaded 
document.addEventListener("DOMContentLoaded", event => {
	((init, calc, draw) => {
		// initialize 
		const params = {};
		init(params);
		calc(params);
		// mainloop 
		const looper = () => {
			calc(params);
			draw(params);
			window.requestAnimationFrame(looper);
		};
		looper();
	})(params => {
		// ----------------------------------------------------------------
		// init 

		// init gene 
		const geneList = [];
		for (let i = 0; i < geneBase64List.length; i++) {
			const geneBase64Data = geneBase64List[i].split(" ");
			const count = Number.parseInt(geneBase64Data[0], 10);
			const score = Number.parseInt(geneBase64Data[1], 10);
			const binary = window.atob(geneBase64Data[2]);
			const bytes = new Uint8Array(binary.length);
			for (let j = 0; j < binary.length; j++) { bytes[j] = binary.charCodeAt(j); }

			const balls = [];
			const length = bytes.length / 11;
			for (let j = 0; j < length; j++) {
				const x1 = bytes[j * 11 + 0];
				const x2 = bytes[j * 11 + 1];
				const y1 = bytes[j * 11 + 2];
				const y2 = bytes[j * 11 + 3];
				const z1 = bytes[j * 11 + 4];
				const z2 = bytes[j * 11 + 5];
				const s = bytes[j * 11 + 6];
				const r = bytes[j * 11 + 7];
				const g = bytes[j * 11 + 8];
				const b = bytes[j * 11 + 9];
				const a = bytes[j * 11 + 10];
				const ratio = (dstAxisSize - 100) / srcAxisSize;
				const x = ((x1 << 8) + (x2 << 0)) * ratio + 50;
				const y = ((y1 << 8) + (y2 << 0)) * ratio + 50;
				const z = ((z1 << 8) + (z2 << 0));
				const radius = s * ratio;
				const color = `rgba(${r}, ${g}, ${b}, ${a / 255})`;
				balls.push({ x, y, z, radius, color, });
			}
			balls.sort((ball1, ball2) => ball2.z - ball1.z);

			geneList.push({ count, score, balls, })
		}
		geneBase64List.length = 0;

		// init graph 
		const graphPath = (() => {
			const x1 = dstAxisSize - 160;
			const y1 = dstAxisSize - 90;
			const x2 = dstAxisSize - 10;
			const y2 = dstAxisSize - 10;
			for (let i = 0; i < geneGraphList.length; i++) { geneGraphList[i][3] = x1 + (x2 - x1) * geneGraphList[i][1]; }
			for (let i = 0; i < geneGraphList.length; i++) { geneGraphList[i][4] = y2 - (y2 - y1) * geneGraphList[i][2]; }
			for (let i = 0; i < geneList.length; i++) {
				for (let j = 0; j < geneGraphList.length; j++) {
					if (geneGraphList[j][0] !== geneList[i].count) { continue; }
					geneList[i].plotX = geneGraphList[j][3];
					geneList[i].plotY = geneGraphList[j][4];
					break;
				}
			}
			let graphPath = `M ${x1} ${y1} L ${x2} ${y1} L ${x2} ${y2} L ${x1} ${y2}`;
			for (let i = 0; i < geneGraphList.length; i++) { graphPath += ` L ${geneGraphList[i][3]} ${geneGraphList[i][4]}`; }
			return graphPath;
		})();
		geneGraphList.length = 0;

		// create management svg elements svg
		const managementElement = (() => {
			const elementList = [];
			const elementListRaw = document.getElementById("partsList").getElementsByTagName("circle");
			for (let i = 0; i < elementListRaw.length; i++) { elementList.push(elementListRaw.item(i)); }

			let index = 0;
			return {
				reset: () => { index = 0; },
				set: (ball, isBlack) => {
					if (index >= elementList.length) {
						for (let i = elementList.length; i <= index; i++) {
							const element = document.createElementNS("http://www.w3.org/2000/svg", "circle");
							document.getElementById("partsList").appendChild(element);
							elementList.push(element);
						}
					}
					const element = elementList[index++];
					element.setAttribute("cx", Math.round(ball.x));
					element.setAttribute("cy", Math.round(ball.y));
					element.setAttribute("r", Math.round(ball.radius + (isBlack ? 4 : 0)));
					element.setAttribute("fill", isBlack ? "black" : ball.color);
				},
				hide: () => {
					for (let i = index; i < elementList.length; i++) {
						const element = elementList[i];
						element.setAttribute("r", 0);
					}
				},
			};
		})();

		// init svg text svg
		const elementText1 = document.createElementNS("http://www.w3.org/2000/svg", "text");
		const elementText2 = document.createElementNS("http://www.w3.org/2000/svg", "text");
		elementText1.setAttribute("x", 10);
		elementText2.setAttribute("x", 10);
		elementText1.setAttribute("y", dstAxisSize - 30);
		elementText2.setAttribute("y", dstAxisSize - 10);
		elementText1.setAttribute("font-size", 16);
		elementText2.setAttribute("font-size", 16);
		elementText1.setAttribute("style", "stroke-width:3;stroke:white;fill:black;paint-order:stroke;stroke-linejoin:round;");
		elementText2.setAttribute("style", "stroke-width:3;stroke:white;fill:black;paint-order:stroke;stroke-linejoin:round;");
		document.getElementsByTagName("svg").item(0).appendChild(elementText1);
		document.getElementsByTagName("svg").item(0).appendChild(elementText2);

		// init svg graph svg
		const elementPath1 = document.createElementNS("http://www.w3.org/2000/svg", "path");
		const elementPath2 = document.createElementNS("http://www.w3.org/2000/svg", "path");
		elementPath1.setAttribute("d", graphPath);
		elementPath2.setAttribute("d", graphPath);
		elementPath1.setAttribute("fill", "transparent");
		elementPath2.setAttribute("fill", "transparent");
		elementPath1.setAttribute("stroke", "white");
		elementPath2.setAttribute("stroke", "black");
		elementPath1.setAttribute("stroke-width", "5px");
		elementPath2.setAttribute("stroke-width", "2px");
		elementPath1.setAttribute("stroke-linecap", "round");
		elementPath2.setAttribute("stroke-linecap", "round");
		elementPath1.setAttribute("stroke-linejoin", "round");
		elementPath2.setAttribute("stroke-linejoin", "round");
		document.getElementsByTagName("svg").item(0).appendChild(elementPath1);
		document.getElementsByTagName("svg").item(0).appendChild(elementPath2);

		// init svg point svg
		const elementPoint = document.createElementNS("http://www.w3.org/2000/svg", "circle");
		elementPoint.setAttribute("cx", geneList[0].plotX);
		elementPoint.setAttribute("cy", geneList[0].plotY);
		elementPoint.setAttribute("r", 4);
		elementPoint.setAttribute("fill", "red");
		elementPoint.setAttribute("stroke", "white");
		elementPoint.setAttribute("stroke-width", "2px");
		document.getElementsByTagName("svg").item(0).appendChild(elementPoint);

		params.step = -1;
		params.geneList = geneList;
		params.managementElement = managementElement;
		params.elementText1 = elementText1;
		params.elementText2 = elementText2;
		params.elementPoint = elementPoint;

		// ----------------------------------------------------------------
	}, params => {
		// ----------------------------------------------------------------
		// calc 

		params.step++;

		// ----------------------------------------------------------------
	}, params => {
		// ----------------------------------------------------------------
		// draw 

		// choice geneData  3
		const index = Math.min(Math.floor(params.step / 5) % (params.geneList.length + (60 * 3 / 5)), params.geneList.length - 1);
		const geneData = params.geneList[index];

		// draw ball 
		params.managementElement.reset();
		for (let i = 0; i < geneData.balls.length; i++) { params.managementElement.set(geneData.balls[i], true); }
		for (let i = 0; i < geneData.balls.length; i++) { params.managementElement.set(geneData.balls[i], false); }
		params.managementElement.hide();

		// draw graph 
		params.elementText1.innerHTML = `count: ${geneData.count}`;
		params.elementText2.innerHTML = `score: ${geneData.score}`;
		params.elementPoint.setAttribute("cx", geneData.plotX);
		params.elementPoint.setAttribute("cy", geneData.plotY);

		// ----------------------------------------------------------------
	});
});

